         &avgcond.Value <= 69 Then
      &maincond.Value = "Training Needed";
   End-If;

   If &avgcond.Value >= 1 And
         &avgcond.Value <= 49 Then
      &maincond.Value = "Training Required";
   End-If;



End-If;

