rem gusty;

class Checkout
   method newCheckoutId() Returns number;
   method popups();
end-class;

method newCheckoutId
   /+ Returns Number +/

   Local number &count;
   SQLExec("Select count(*) From PS_L_CHECKOUTHIST", &count);
   Return &count;
end-method;


method popups
   Local Record &rec = GetLevel0()(1).GetRecord(Record.L_HISTORYWORK);
   Local Field &main = &rec.GetField(Field.L_MAIN_COND);



   If &main.Value = "Training Needed" Then
      Warning (" Employee needs training");
   End-If;

   If &main.Value = "Training Required" Then
      Warning (" Employee must be trained");
   End-If;
end-method;
